import { gql } from 'apollo-boost'

const login = gql`
  query login($email: String) {
    login(email: $email) {
      email
      firstname
      lastname
      password
    }
  }
`
const getBuyersQuery = gql`
  {
    buyer(email: $email)
  }
`

export { getAuthorsQuery, getBooksQuery, getBuyersQuery, login }
